column8:
ゴールドサテンの輝きでドレスアップした究極の収能機能を誇るお化粧ポーチです。<br><br>【特徴】<br>大きく開き、出し入れスムーズなダブルファスナー仕様<br>ベルトでしっかりキープするリップスタンド付き<br>小物の収納に重宝するゴムポケット＆大きめポケット<br>中が確認できる便利なクリアポケット<br>汚れ防止カバーが付いたブラシホルダー<br>
<br>サイズ/約90×190×55mm<br>素材/ポリエステル<br>
生産国/中国<br><br>

【化粧ポーチ】【コスメポーチ】【機能的】<br><br>
